import React from "react";

function Services() {
  return (
      <div className="services">
          <div class="bigimage">

          <div id="button_back" style={{paddingLeft:"10%"}}>
            <button id="button1">Download App</button>
            <button id="button2"style={{marginRight:"10%"}}>Remove Background</button>
</div>
      </div>

      <div class="space">
        
</div>
    <div class="containers">
    <h1 style={{textAlign:"center"}}>Tools and API</h1><br/>
    <p style={{textAlign:"center"}}>Say hello to the new era of editing where we help you transition from the traditional hours-long,<br/>
costly image editing to a blink of an eye automated image editing solution.</p><br/><br/>
</div>



      </div>
  );
}

export default Services;
